jQuery(function(a){a(".base-table-list").on("click","a.-row-ajax-clean",function(c){c.preventDefault();var b=a(this);if(b.hasClass("-cleaned")){return}a.ajax({type:"GET",url:b.attr("href"),beforeSend:function(d){b.html(b.data("spinner"))},success:function(d){if(d.success){b.text(d.data).addClass("-cleaned")}else{b.text(a(d.data).text());console.log(d)}}})}).on("click","a.-row-ajax-cache",function(c){c.preventDefault();var b=a(this);if(b.hasClass("-cached")){return}a.ajax({type:"GET",url:b.attr("href"),beforeSend:function(d){b.html(b.data("spinner"))},success:function(d){console.log(d);if(d.success){b.text(d.data).addClass("-cached")}else{b.text(a(d.data).text());console.log(d)}}})})});